  name: MessageQueueErrorCode
  nameWithType: MessageQueueErrorCode
  fullName: System.Messaging.MessageQueueErrorCode
  type: Enum
  summary: "Identifierar källan för ett fel uppstod för Message Queuing-programmet som genererade en <xref href=&quot;System.Messaging.MessageQueueException&quot;> </xref> undantag."
  remarks: "Uppräkningen MessageQueueErrorCode ger detaljerad information om ett fel under en asynkron åtgärd.       Den <xref:System.Messaging.MessageQueueException>använder den <xref:System.Messaging.MessageQueueException.MessageQueueErrorCode%2A>egenskapen för att identifiera typ av MSMQ-fel.</xref:System.Messaging.MessageQueueException.MessageQueueErrorCode%2A> </xref:System.Messaging.MessageQueueException> Värdet för MessageQueueErrorCode anger en textsträng som ska associeras med fel."
  example:
  - "The following code example verifies whether a Message Queuing queue exists, and then deletes it.  \n  \n [!code-vb[MessageQueue.ExistsDelete#1](~/add/codesnippet/visualbasic/t-system.messaging.messa_4_1.vb)]\n [!code-cs[MessageQueue.ExistsDelete#1](~/add/codesnippet/csharp/t-system.messaging.messa_4_1.cs)]\n [!code-cpp[MessageQueue.ExistsDelete#1](~/add/codesnippet/cpp/t-system.messaging.messa_4_1.cpp)]"
  syntax:
